import { Button, Grid, Link, TextField } from "@mui/material";
import "./Register.css";
import { useNavigate } from "react-router-dom";
import { useForm } from "react-hook-form";

function Register(): JSX.Element {
      // use form for form validation
      const {
        register,
        handleSubmit,
        formState: { errors },
      } = useForm();
      const send = () => {};
        const navigate = useNavigate();
    return (
        <div className="Register Box">
          <form onSubmit={handleSubmit(send)}>
          <h1>Register</h1>
          <TextField placeholder="enter your firstName"
          {...register("firstName", { required: true })}
          error={Boolean(errors.firstName)}
          helperText={errors.firstName && "First name is required"}
          ></TextField>
          <br/>
          <br/>
          <TextField placeholder="enter your lastName"
          {...register("lastName", { required: true })}
          error={Boolean(errors.lastName)}
          helperText={errors.lastName && "Last name is required"}
          ></TextField>
          <br/>
          <br/>
          <TextField placeholder="enter your email"
          {...register("email", {
          required: true,
          pattern: /^[^\s@]+@[^\s@]+\.[^\s@]+$/,
          })}
          error={Boolean(errors.email)}
          helperText={
          errors.email &&
          "Email is required and must be a valid email address"
          }
          ></TextField>
          <br/>
          <br/>
          <TextField placeholder="enter your password"
            {...register("password", {
              required: true,
              minLength: 4,
            })}
            error={Boolean(errors.password)}
            helperText={
              errors.password &&
              "Password must have a minimum of 4 characters"
            }
          ></TextField>
          <br/>
          <br/>
          <Button onClick={()=>navigate("/VacationsList")}>Register</Button>
          <div className="Question">
          <Grid container>
                <Grid item>
                already a member?
                  <Link  onClick={()=>navigate("/login")}>
                    {"Login"} 
                  </Link >
                </Grid>
              </Grid>
              </div>
              </form>
        </div>
      );
}

export default Register;
